style.css:
/* Change the background color and text color */
body {
    background-color: #282c34; /* Dark background */
    color: #ffffff; /* White text */
}

/* Style all links */
a {
    color: #61dafb; /* Light blue for links */
}

a:hover {
    color: #21a1f1; /* Darker blue on hover */
}

/* Style headers */
h1, h2, h3 {
    color: #61dafb; /* Light blue for headers */
}

/* Add some padding */
* {
    padding: 10px;
    margin: 0;
}

/* Customize buttons */
button {
    background-color: #61dafb;
    color: #282c34;
    border: none;
    padding: 10px 15px;
    border-radius: 5px;
    cursor: pointer;
}

button:hover {
    background-color: #21a1f1;
}
